import React from 'react';
import Lugu from './Lugu';

const Lood: React.FC<any> = ({ music }) => {
    return (
        <div>
            <ul>
                {
                music.map(((lugu:any) => {
                    return (
                        <Lugu 
                            key={lugu.looPilt} 
                            looPilt={lugu.looPilt}
                            style={{width: '500px'}}
                        />
                    )
                }))}
            </ul>
        </div>
    )
}

export default Lood;
